import React, { useEffect } from "react";
import { Link } from "react-router-dom";
import { getPokemons } from "../../actions";
import { useDispatch } from "react-redux";
import "./Landing.css";

export default function Landing() {
  const dispatch = useDispatch();

  useEffect(() => {
    //cargo los pokes en el estado cuando se monta el componente
    dispatch(getPokemons());
  }, []);

  return (
    <div className="landing">
      <img
        src="https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/e0aebcf5-946d-44a7-bb9e-62e9964adb2b/d8z5de2-bbc5c05d-8a03-461e-9a3d-b206fa65879e.png/v1/fill/w_1024,h_576,q_80,strp/pikachu_evolution_line_minimalist_wallpaper_by_brulescorrupted_d8z5de2-fullview.jpg?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..KdOy1lfezrkyZX2chypL7pfuIQHSoEGucIEWoEuqLq4"
        alt=""
      />
      <Link to="/home">
        <button class="btn">GO</button>
      </Link>
    </div>
  );
}
